import React from "react";
import Scroll from 'react-scroll';

import "./Navbar.css"
const Navbar = (props)=>{

    const toPropostio = ()=>{
        Scroll.scroller.scrollTo("proposito");
    }
    const toComoFunciona = ()=>{
        Scroll.scroller.scrollTo("comofunciona");
    }
    const toConhecaOApp = ()=>{
        Scroll.scroller.scrollTo("conhecaoapp");
    }
    return (
        <div className="ctn-navbar">
            <div className="logo-ctn">
                <img src={"logo.svg"} className='logo-navbar'/>
            </div>
            <div className="links-ctn">
                <a  onClick={toPropostio}>PROPÓSITO</a>
                <a  onClick={toComoFunciona}>COMO FUNCIONA</a>
                <a  className="yellow-text" onClick={toConhecaOApp}>CONHEÇA O APP</a>
            </div>
        </div>
    )
}

export default Navbar;
